import React from 'react';
import myntraLogo from './myntra.svg';
import './App.css';

function App() {
  return (
    <>
      <nav className="navbar navbar-light bg-dark">
        <a className="navbar-brand" href="#">
          <img src={myntraLogo} width="30" height="30" alt="Myntra Logo"/>
        </a>
        <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div className="navbar-nav">
            <a className="nav-item nav-link active text-white" href="#">Home <span className="sr-only">(current)</span></a>
            <a className="nav-item nav-link" href="#">Features</a>
            <a className="nav-item nav-link" href="#">Pricing</a>
            <a className="nav-item nav-link disabled" href="#" tabIndex="-1" aria-disabled="true">Disabled</a>
          </div>
        </div>
      </nav>
    </>
  );
}

export default App;
